import React from 'react'

const Pagination = ({page, changePage, pagesArray}) => {
  return (
    <div className="page_wraper">
        {pagesArray.map(p => 
          <span className={page === p ? "page page_current" : "page"}
          key={p}
          onClick={() => changePage(p)}
          >
            {p}
          </span>
        )}
    </div>
  )
}

export default Pagination
